import React from "react";
import { Navbar } from 'react-bootstrap'
import logo from '../../images/Raft1Logo.png'

function Nav(props) {
  console.log('nav props', props)
  return (

    <Navbar bg="primary" variant="dark">

      <Navbar.Brand href="/">
        <img
          src={logo}
          height='75px'
          className="d-inline-block align-top"
          alt="Raft1 logo"
        />
        {'Raft1 Scheduler'}
      </Navbar.Brand>
      {props.user ?
        (
          <Navbar.Text>
            Signed in as: {props.user}. <button onClick={props.logOut}>Log Out?</button>
          </Navbar.Text>
        )
        :
        <br />
      }
    </Navbar>
  );
}

export default Nav;
